import {React , Component} from 'react';
import  { FaHtml5 , FaCss3 , FaReact } from 'react-icons/fa';
import { Axios } from 'axios';
import './style.css'


class Work extends Component {

  state = {
    works : []
  }

  componentDidMount(){
    Axios.get('json/data.json').then(res =>{ this.setState({works : res.data.works})})
  }

    render(){
      const {works} = this.state;
      return(
        <section className='container'>
        <h2 className='sec-header'> My Work</h2>
        <div className='work-container'>
         <div className='work-box'>
             <FaHtml5  />
             <div>
               <h3>HTML for website</h3>
               <hr />
             </div>
             <p>single page website , fully responsive , with the latest techanolgies</p>
         </div>
         <div className='work-box'>
             <FaCss3  />
             <div>
               <h3>HTML-CSS-website</h3>
               <hr />
             </div>
             <p>single page website , fully responsive , with the latest techanolgies</p>
         </div>
         <div className='work-box'>
             <FaReact  />
             <div>
               <h3>React website</h3>
               <hr />
             </div>
             <p>single page website , fully responsive , with the latest techanolgies</p>
         </div>
        </div>
     </section>
      )
    }
}

export default Work ;
